import React from "react";

const Home = () => {
  return (
    <>
      <div className='home-page'>
        <div className='home-div'>
          <p className='pt-5'>Welcome</p>
          <h1>We are MERN Developers</h1>
        </div>
      </div>
    </>
  );
};

export default Home;
